/* Procedure structure for procedure `spUpdateWorkSchedDetails` */

/*!50003 DROP PROCEDURE IF EXISTS  `spUpdateWorkSchedDetails` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateWorkSchedDetails`(
	workId varchar(50),
	days VARchar(50),
	inam VARCHAR(50),
	outam VARCHAR(50),
	inpm VARCHAR(50),
	outpm varchar(50))
BEGIN
	SET @getDays =(SELECT day from workscheduledetail 
	where Day = days and workScheduleDetail = workId); 
	
	set @getcount	=(select count(DAY) FROM workscheduledetail 
	WHERE DAY = days AND workScheduleDetail = workId);
	
	
	IF(@getDays !=	'' )	THEN
	update workscheduledetail SET 
	inAM	=	inam,
	outAM	=	outam,
	inPM	=	inpm,
	outPM	=	outpm 
	where workScheduleDetail= workId and day=days;
	end if;
	
	if(@getcount = 0)THEN
	
	 IF(inam !='' or outam !='' or inpm !='' or outpm !='') then
	 INSERT INTO workscheduledetail set
	 `workscheduleDetail` 	=	workId,
	 `Day` 		=	days,
	 `inAM` 	=	inam,
	 `outAM` 	=	outam,
	  `inPM` 	=	inpm,
	   `outPM` 	=	outPM;
	   
	   end if;
	   end if;
	   
	   IF(inam ='' and outam ='' and inpm ='' and outpm= '') then
	   
	   DELETE FROM workscheduledetail where workScheduleDetail = workId and 
	   Day = days;
	   
	   end if;
    END */$$
DELIMITER ;

